import { useState } from "react";
import Button from "./Button";
import Dice from "./Dice";

function App() {
    const [num, setNum] = useState(1);

    return (
        <div>
            <div>
                <Button>던지기</Button>
                <Button>처음부터</Button>
            </div>
            <Dice color="red" num={num} />
        </div>
    );
}

export default App;
